import React, { Component } from "react";
import { app } from "../utils/base";

class Home extends Component {
  state = {};

  componentDidUpdate = () => {
    let user = app.auth().currentUser;
    console.log(user);
    return <div>{user}</div>;
  };
  render() {
    return (
      <>
        <h1>Home</h1>
        <button onClick={() => app.auth().signOut()}>Sign out</button>
      </>
    );
  }
}

export default Home;
